  useEffect(() => {
    const fetchPosts = async () => {
      const { data } = await supabase.from("Game").select();

      setPosts(data);
    };
    fetchPosts();
    console.log(posts);
  }, [props]);


  return (
    <div>
      <h1>Say hi to</h1>
			<p></p>
    </div>
  );
};

export default View;
